import React from "react";
import record from "./db.json";
const Home = () => {
  console.log(record);
  return (
    <>
      <div
        style={{
          border: "2px solid black",
          width: "50%",
          height: "50vh",
          margin: "auto",
        //   display:"flex"
        }}
      >
       <div style={{display:"flex",paddingLeft:"1000px"}}>
       <h4>Time</h4>
        {record.map((value) => {
          return <p>{value.name}</p>;
        })}
       </div>
       {record.map((val, index) => {
          return <p>{val.data[index].time} </p>;
        })}

      </div>
    </>
  );
};

export default Home;
